DROP TABLE IF EXISTS `navidad2022_moments`;
CREATE TABLE `navidad2022_moments` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'Id interno',
  `group` int(11) NOT NULL,
  `date` datetime NOT NULL COMMENT 'Fecha y hora del momento ganador',
  `is_used` tinyint(1) NOT NULL DEFAULT '0' COMMENT 'Si ha sido usado',
  `participant_id` int(11) DEFAULT NULL COMMENT 'Participante que ha usado el momento',
  `created` datetime NOT NULL COMMENT 'Fecha de creaci贸n del registro',
  `created_by_user_id` int(11) DEFAULT NULL COMMENT 'Usuario de creaci贸n del registro',
  `modified` datetime NOT NULL COMMENT 'Fecha de modificaci贸n del registro',
  `modified_by_user_id` int(11) DEFAULT NULL COMMENT 'Usuario de modificaci贸n del registro',
  PRIMARY KEY (`id`),
  KEY `created_by_user_id` (`created_by_user_id`),
  KEY `modified_by_user_id` (`modified_by_user_id`),
  UNIQUE `participant_id` (`participant_id`),
  KEY `is_used` (`is_used`),
  KEY `group` (`group`),
  CONSTRAINT `moments_ibfk_1` FOREIGN KEY (`created_by_user_id`) REFERENCES `navidad2022_users` (`id`) ON DELETE SET NULL,
  CONSTRAINT `moments_ibfk_2` FOREIGN KEY (`modified_by_user_id`) REFERENCES `navidad2022_users` (`id`) ON DELETE SET NULL,
  CONSTRAINT `moments_ibfk_5` FOREIGN KEY (`participant_id`) REFERENCES `navidad2022_participants` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT='Momentos ganadores';



DROP TABLE IF EXISTS `navidad2022_stores`;
CREATE TABLE `navidad2022_stores` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'Id interno',
  `code` VARCHAR(3) NOT NULL,
  `group` int(11) NOT NULL,
  `created` datetime NOT NULL COMMENT 'Fecha de creaci贸n del registro',
  `created_by_user_id` int(11) DEFAULT NULL COMMENT 'Usuario de creaci贸n del registro',
  `modified` datetime NOT NULL COMMENT 'Fecha de modificaci贸n del registro',
  `modified_by_user_id` int(11) DEFAULT NULL COMMENT 'Usuario de modificaci贸n del registro',
  PRIMARY KEY (`id`),
  KEY `created_by_user_id` (`created_by_user_id`),
  KEY `modified_by_user_id` (`modified_by_user_id`),
  CONSTRAINT `stores_ibfk_1` FOREIGN KEY (`created_by_user_id`) REFERENCES `navidad2022_users` (`id`) ON DELETE SET NULL,
  CONSTRAINT `stores_ibfk_2` FOREIGN KEY (`modified_by_user_id`) REFERENCES `navidad2022_users` (`id`) ON DELETE SET NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT='Tiendas';

	
UPDATE navidad2022_stores SET code = CONCAT(0, code) WHERE LENGTH(code)<3;
